class View{



    /**
     * model for Movie-vegas
     * declare class variables/attributes as private (local var and Accessor as a object literal);
     * @type {Object}
     */





    printMovieVegasDetails(objects_entry_point) {

                          let stop=0;
                   return(


                       <div id="items">

                          <div id="re"> {setInterval(function () {

                              stop++;
                              if(stop===100){
                                  clearInterval(this)
                                  alert()
                              }

                              return <div>{document.getElementById("result").textContent=""+objects_entry_point} </div>


                          },1000)}</div>   <div id="result"> </div>
                       </div>)




               }




}



export  default View;
